import React, { Component } from 'react'
import { Container } from 'bloomer/lib/layout/Container';

export default class Chat extends Component {
  render() {
    return (
      <Container isColor='info'>
        {this.props.users.map(user => {
          return <p>{user}</p>
        })}
      </Container>
    )
  }
}
